import './Resume.css';

function Resume() {
    return (
        <div className="Resume">
            <div className="experience">
                <div className="title">Work Experience</div>
            </div>
            <div className="title">
                Education
            </div>
            <div className="title">
                Skills + Expertise
            </div>
        </div>
    );
}

export default Resume;
